script: |
  super -f text -I q676.spq | sort > q676.out

inputs:
  - name: q676.spq
    data: |
      SELECT - col2 + + col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT NULL BETWEEN + col2 + col2 - col0 * + col0 AND ( - col1 * + col1 + col0 * col1 - col2 );
  - name: tab1

outputs:
  - name: q676.out
    data: |
